import React from 'react';
import ReactDOM from 'react-dom';
import Avatar from '../src/avatar.jsx';

const onDrag = (src) => {
  const img = document.getElementById('preview')
  img.src = src
}

ReactDOM.render(
  <Avatar
    width={500}
    height={400}
    cropRadius={150}
    onDrag={onDrag}
    src={'data:image/jpg;base64,'}
  />,
  document.getElementById('root')
)